# Rime dictionary
# encoding: utf-8
#
# 明月拼音扩展词库 - 植物名
#
# 本词库基于
#     1. 中国植物名称数据库（Chinese Plant Names Index, CPNI）v1.0。
#
# 生僻字
#     1. 扩展A区（U+3400—U+4DB5）：㼎、䉡。
#     2. 扩展B区（U+20000—U+2A6D6）：𣐿(木衣)、𣗋（木党）。
#     3. 扩展C区（U+2A700—U+2B734）：𪢮（囗/栾,全包围结构）、𫈰（艹洽）。
#         1. 𪢮（luán） 出现于 土𪢮儿 Apios 这一个属中，其对应繁体字为“圞”，此处从《中国植物志》使用类推简化字𪢮。
#         2. 𫈰（qià） 出现于 𫈰草 Koeleria 这一个属中。
#     4. 非Unicode汉字：[月君]、[艹杭]、[艹宾]。
#         1. [月君] 出现于 鸡[月君]梅花草 Parnassia wightiana 中，[月君]为肫的异体，于是此名称收为鸡肫梅花草。
#         2. [艹杭] 出现于 [艹杭]子梢 Campylotropis 这一个属中，目前多写作杭子梢，于是收为杭子梢。
#         3. [艹宾] 出现于 麦[艹宾]草 Elymus tangutorum 中，对应繁体字为“薲”（pín），而 Flora of China 改写作麦宾草，故同时收入麦薲草和麦宾草。
